import React, { Component } from 'react'
import Setup from './setup';

export default class TestSetup extends Component {
  state: any = {
    secondProgress: [
      { current: 'N', reached: 'Y', secProgress: 'arr0', secTips: '哈哈哈哈回复我是测试的' },
      { current: 'N', reached: 'Y', secProgress: 'arr1', secTips: '哈哈哈哈回复我是测试的' },
      { current: 'N', reached: 'Y', secProgress: 'arr2', secTips: '哈哈哈哈回复我是测试的' },
      { current: 'Y', reached: 'Y', secProgress: 'arr3', secTips: '哈哈哈哈回复我是测试的' },
      { current: 'N', reached: 'N', secProgress: 'arr4', secTips: '哈哈哈哈回复我是测试的' }
    ]
  }
  render() {
    const { secondProgress } = this.state;
    return (
      <div>
        <h1>测试进度条</h1>
        <hr/>
        <div style={{width: '80%', border: '1px solid red', height: '200px'}}>
          <Setup progress={secondProgress} />
        </div>
      </div>
    )
  }
}
